import React, { useEffect, useState } from "react";
import MainCSS from '../styles/Main.module.css'
import Card from "./Card";

export default function GridCard() {
    const [info, setInfo] = useState([])

    async function getDate() {
        let response = await fetch('http://localhost:3000/home', { method: 'get' })
            .then(res => res.json()).then(r => r.data)

        setInfo(response)
    }

    useEffect(() => {
        getDate()
    }, [])
    function x(y = {}) {
        let key = Object.keys(y).length
        return (key - 1) / 4
    }

    return <div className={MainCSS.display_grid}>
        {info.map((elem, index) => {
            return <Card key={index} name={elem.nameQUE} num={x(elem)} />
        })}
    </div>
}
